SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";

CREATE TABLE `admins` (
  `adminId` int(11) NOT NULL,
  `adminName` varchar(128) NOT NULL,
  `adminEmail` varchar(128) NOT NULL,
  `adminPassword` varchar(128) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


CREATE TABLE `movies` (
  `ID` int(11) NOT NULL,
  `Title` varchar(255) DEFAULT NULL,
  `Studio` varchar(255) DEFAULT NULL,
  `Status` varchar(255) DEFAULT NULL,
  `Sound` varchar(255) DEFAULT NULL,
  `Versions` varchar(255) DEFAULT NULL,
  `RecRetPrice` decimal(5,2) DEFAULT NULL,
  `Rating` varchar(255) DEFAULT NULL,
  `Year` int(4) DEFAULT NULL,
  `Genre` varchar(255) DEFAULT NULL,
  `Aspect` varchar(255) DEFAULT NULL,
  `num_searched` int(8) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


CREATE TABLE `users` (
  `usersId` int(11) NOT NULL,
  `usersName` varchar(128) NOT NULL,
  `usersEmail` text NOT NULL,
  `usersNewsletter` bit(1) NOT NULL,
  `usersNotifications` bit(1) NOT NULL,
  `verify_code` varchar(150) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `is_verified` bit(1) NOT NULL DEFAULT b'0'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;



ALTER TABLE `admins`
  ADD PRIMARY KEY (`adminId`);

ALTER TABLE `movies`
  ADD PRIMARY KEY (`ID`);

ALTER TABLE `users`
  ADD PRIMARY KEY (`usersId`);


ALTER TABLE `admins`
  MODIFY `adminId` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=2;

ALTER TABLE `movies`
  MODIFY `ID` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=2299;

ALTER TABLE `users`
  MODIFY `usersId` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=3;
COMMIT;
